INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('319', 'True', 'An Audience with...', 'en', 'False', '1978-01-08', 'An Audience with... is a British entertainment television show produced by London Weekend Television, in which a host, usually a singer or comedian, performs for an invited audience of celebrity guests, interspersed with questions from the audience, in a light hearted revue/tribute style.', 'https://image.tmdb.org/t/p/original/5g8MIEmfYrZYgFQoGQKPmd3KgD8.jpg', 'https://image.tmdb.org/t/p/original/lB8kUSnmvM3hLTXxVHpN9LYTpDE.jpg', NULL, '5.3', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('320', 'True', 'The Good Wife', 'en', 'False', '2009-09-22', 'Alicia Florrick boldly assumes full responsibility for her family and re-enters the workforce after her husband''s very public sex and political corruption scandal lands him in jail.', 'https://image.tmdb.org/t/p/original/fV740jZ1ZIwRcLwgBEsiEHrdjPG.jpg', 'https://image.tmdb.org/t/p/original/lasNCd45fpPLirlA7QxkuopWro.jpg', 'https://www.youtube.com/watch?v=bybDgWgp-Vo', '7.6', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('321', 'True', 'The Mary Tyler Moore Show', 'en', 'False', '1970-09-19', '30-year-old single Mary Richards moves to Minneapolis to start a new life after a romantic break-up. There she reacquaints with Phyllis who rents her a room, and meets her upstairs neighbor and new best friend Rhoda. Mary unexpectedly lands a job as associate producer at the TV station WJM, where she works alongside her bristly boss, Lou; the comical newswriter, Murray; and the newscast''s often-incompetent anchor, Ted.', 'https://image.tmdb.org/t/p/original/9v8sGXErTNvUdhHwTecgrPdlu7r.jpg', 'https://image.tmdb.org/t/p/original/nFsgsmK7isjtdEVTL35mJEQZHuO.jpg', NULL, '7.5', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('322', 'True', 'Quincy, M.E.', 'en', 'False', '1976-10-03', 'Quincy, M.E. is an American television series from Universal Studios pert in several of the later episodes.', 'https://image.tmdb.org/t/p/original/lcuacKO5gwY2IjdmgAoEgSlsaTV.jpg', 'https://image.tmdb.org/t/p/original/sZ58zg6sU5jKhKiHCzstlokkQ90.jpg', 'https://www.youtube.com/watch?v=6KMQ_1rnLbY', '7.5', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('323', 'True', 'Desperate Housewives', 'en', 'False', '2004-10-03', 'Looking down on her friends and family isn''t a way of life for Mary Alice Young... it''s a way of death. One day, in her perfect house, in the loveliest of suburbs, Mary Alice ended it all. Now she''s taking us into the lives of her family, friends and neighbors, commenting from her elevated P.O.V.', 'https://image.tmdb.org/t/p/original/vbz8B3pIrGjWKY6Y3OhUDVugHz8.jpg', 'https://image.tmdb.org/t/p/original/mmL7HMdGOEaA8tR58s1PrpFsSmY.jpg', NULL, '7.9', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('326', 'True', 'What We Do in the Shadows', 'en', 'False', '2019-03-27', 'A documentary-style look into the daily (or rather, nightly) lives of a group of vampires in Staten Island who have “lived” together for hundreds and hundreds of years.', 'https://image.tmdb.org/t/p/original/mKikck71CvVISUSTLk29fwRbH4y.jpg', 'https://image.tmdb.org/t/p/original/chckIPxBbvyFCcCFz8VPHgWCIHL.jpg', 'https://www.youtube.com/watch?v=EGQChk9zGyQ', '8', 'Returning Series') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('327', 'True', 'I Dream of Jeannie', 'en', 'False', '1965-09-18', 'While on a mission, American astronaut Captain Tony Nelson is forced to make an emergency landing that will forever change his life. On a deserted South Pacific island, Captain Nelson happens upon a bottle containing a beautiful two-thousand-year-old female genie named Jeannie. Rescuing her from the bottle nets Tony the requisite three wishes, and then some, when Jeannie pledges total devotion to her new "master".', 'https://image.tmdb.org/t/p/original/8dGgunEwWsPcXHv87gI19QncLrw.jpg', 'https://image.tmdb.org/t/p/original/ljlyB3C3uU8Hd1krfEsYn2BVyaj.jpg', 'https://www.youtube.com/watch?v=3JNab9g4Xe0', '7.8', 'Ended') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('328', 'True', 'Let''s Make a Deal', 'en', 'False', '2009-10-05', 'Audience members dress up in outlandish costumes to get host Wayne Brady''s attention in an attempt to make deals for trips, prizes, cars or cash, while trying to avoid the dreaded Zonks.', 'https://image.tmdb.org/t/p/original/pkKUW6wk2yfPc66YF7647ARi6uv.jpg', 'https://image.tmdb.org/t/p/original/pgtvpEKsSW2dwVwEnXgiw72I03V.jpg', NULL, '5.6', 'Returning Series') ON CONFLICT DO NOTHING;
INSERT INTO media(mediaid, type, name, originallanguage, adult, releasedate, overview, backdroppath, posterpath, trailerlink, tmdbrating, status) VALUES('329', 'True', 'The Cosby Show', 'en', 'False', '1984-09-20', 'The Cosby Show is an American television situation comedy starring Bill Cosby, which aired for eight seasons on NBC from September 20, 1984 until April 30, 1992. The show focuses on the Huxtable family, an upper middle-class African-American family living in Brooklyn, New York.', 'https://image.tmdb.org/t/p/original/qsAoCIQVoG4XsptgU4Pe90kstv1.jpg', 'https://image.tmdb.org/t/p/original/9fV71KxeALKkkznUwFe0eDq65rs.jpg', NULL, '7', 'Ended') ON CONFLICT DO NOTHING;
